script: |
  super -f text -I q4564.spq | sort > q4564.out

inputs:
  - name: q4564.spq
    data: |
      SELECT DISTINCT * FROM tab0 (FORMAT parquet) WHERE NOT + col2 * col1 * + col2 - - col2 IN ( tab0.col2 + - col1 * col2 + col0 * - tab0.col2 );
  - name: tab0

outputs:
  - name: q4564.out
    data: |
      24	86	33
      35	97	1
      89	91	82
